import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { toast } from 'react-toastify';
import { 
  DocumentTextIcon,
  ClockIcon,
  CheckCircleIcon,
  ExclamationTriangleIcon,
  PlusIcon,
  ChartBarIcon,
  CalendarIcon,
  EyeIcon
} from '@heroicons/react/24/outline';

const Dashboard = () => {
  const [reports, setReports] = useState([]);
  const [loading, setLoading] = useState(true);

  const fetchReports = async () => {
    try {
      const response = await axios.get('/api/user-reports');
      setReports(response.data);
    } catch (error) {
      toast.error('Failed to fetch reports');
      console.error('Error fetching reports:', error);
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    fetchReports();
  }, []);

  const getStatusIcon = (status) => {
    switch (status) {
      case 'completed':
        return <CheckCircleIcon className="w-5 h-5 text-green-500" />;
      case 'processing':
        return <ClockIcon className="w-5 h-5 text-yellow-500" />;
      case 'failed':
        return <ExclamationTriangleIcon className="w-5 h-5 text-red-500" />;
      default:
        return <DocumentTextIcon className="w-5 h-5 text-gray-500" />;
    }
  };

  const getStatusColor = (status) => {
    switch (status) {
      case 'completed':
        return 'bg-green-100 text-green-800';
      case 'processing':
        return 'bg-yellow-100 text-yellow-800';
      case 'failed':
        return 'bg-red-100 text-red-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };

  if (loading) {
    return (
      <div className="min-h-screen bg-medical-50 flex items-center justify-center">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary-600 mx-auto"></div>
          <p className="mt-4 text-medical-600">Loading your reports...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-medical-50 p-6">
      <div className="max-w-7xl mx-auto space-y-8">
        {/* Header */}
        <div className="flex flex-col sm:flex-row sm:items-center sm:justify-between">
          <div>
            <h1 className="text-3xl font-bold text-medical-900">Dashboard</h1>
            <p className="mt-2 text-medical-600">
              View your blood test reports and analysis results
            </p>
          </div>
        </div>

        {/* Stats Cards */}
        <div className="grid grid-cols-1 md:grid-cols-4 gap-6">
          <div className="bg-white rounded-xl shadow-sm border border-medical-200 p-6">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <DocumentTextIcon className="w-8 h-8 text-medical-600" />
              </div>
              <div className="ml-4">
                <p className="text-sm font-medium text-medical-600">Total Reports</p>
                <p className="text-2xl font-bold text-medical-900">{reports.length}</p>
              </div>
            </div>
          </div>

          <div className="bg-white rounded-xl shadow-sm border border-medical-200 p-6">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <CheckCircleIcon className="w-8 h-8 text-green-600" />
              </div>
              <div className="ml-4">
                <p className="text-sm font-medium text-medical-600">Completed</p>
                <p className="text-2xl font-bold text-medical-900">
                  {reports.filter(r => r.processing_status === 'completed').length}
                </p>
              </div>
            </div>
          </div>

          <div className="bg-white rounded-xl shadow-sm border border-medical-200 p-6">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <ClockIcon className="w-8 h-8 text-yellow-600" />
              </div>
              <div className="ml-4">
                <p className="text-sm font-medium text-medical-600">Processing</p>
                <p className="text-2xl font-bold text-medical-900">
                  {reports.filter(r => r.processing_status === 'processing').length}
                </p>
              </div>
            </div>
          </div>

          <div className="bg-white rounded-xl shadow-sm border border-medical-200 p-6">
            <div className="flex items-center">
              <div className="flex-shrink-0">
                <ExclamationTriangleIcon className="w-8 h-8 text-red-600" />
              </div>
              <div className="ml-4">
                <p className="text-sm font-medium text-medical-600">Failed</p>
                <p className="text-2xl font-bold text-medical-900">
                  {reports.filter(r => r.processing_status === 'failed').length}
                </p>
              </div>
            </div>
          </div>
        </div>

        {/* Charts Section */}
        {reports.length > 0 && (
          <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
            {/* Status Distribution Pie Chart */}
            <div className="bg-white rounded-xl shadow-sm border border-medical-200 p-6">
              <h2 className="text-lg font-semibold text-medical-900 mb-6 text-center">
                Report Status Distribution
              </h2>
              <div className="flex justify-center">
                <div className="relative w-48 h-48">
                  {(() => {
                    const statusCounts = {
                      completed: reports.filter(r => r.processing_status === 'completed').length,
                      processing: reports.filter(r => r.processing_status === 'processing').length,
                      failed: reports.filter(r => r.processing_status === 'failed').length,
                      pending: reports.filter(r => r.processing_status === 'pending').length
                    };

                    const total = reports.length;
                    const colors = ['#10B981', '#F59E0B', '#EF4444', '#6B7280'];
                    const labels = ['Completed', 'Processing', 'Failed', 'Pending'];

                    let currentAngle = 0;
                    const segments = Object.entries(statusCounts).map(([status, count], index) => {
                      const percentage = total > 0 ? (count / total) * 100 : 0;
                      const angle = (percentage / 100) * 360;
                      const startAngle = currentAngle;
                      currentAngle += angle;

                      return {
                        status,
                        count,
                        percentage,
                        startAngle,
                        angle,
                        color: colors[index],
                        label: labels[index]
                      };
                    }).filter(segment => segment.count > 0);

                    return (
                      <svg className="w-full h-full transform -rotate-90" viewBox="0 0 100 100">
                        {segments.map((segment, index) => {
                          const radius = 40;
                          const circumference = 2 * Math.PI * radius;
                          const strokeDasharray = (segment.angle / 360) * circumference;
                          const strokeDashoffset = 0;

                          const x1 = 50 + radius * Math.cos((segment.startAngle * Math.PI) / 180);
                          const y1 = 50 + radius * Math.sin((segment.startAngle * Math.PI) / 180);
                          const x2 = 50 + radius * Math.cos(((segment.startAngle + segment.angle) * Math.PI) / 180);
                          const y2 = 50 + radius * Math.sin(((segment.startAngle + segment.angle) * Math.PI) / 180);

                          const largeArcFlag = segment.angle > 180 ? 1 : 0;

                          return (
                            <g key={segment.status}>
                              <path
                                d={`M 50 50 L ${x1} ${y1} A ${radius} ${radius} 0 ${largeArcFlag} 1 ${x2} ${y2} Z`}
                                fill={segment.color}
                                className="transition-all duration-300 hover:opacity-80"
                              />
                            </g>
                          );
                        })}
                        <circle cx="50" cy="50" r="15" fill="white" />
                      </svg>
                    );
                  })()}
                </div>
              </div>
              <div className="mt-6 space-y-2">
                {(() => {
                  const statusCounts = {
                    completed: reports.filter(r => r.processing_status === 'completed').length,
                    processing: reports.filter(r => r.processing_status === 'processing').length,
                    failed: reports.filter(r => r.processing_status === 'failed').length,
                    pending: reports.filter(r => r.processing_status === 'pending').length
                  };

                  const total = reports.length;
                  const colors = ['#10B981', '#F59E0B', '#EF4444', '#6B7280'];
                  const labels = ['Completed', 'Processing', 'Failed', 'Pending'];

                  return Object.entries(statusCounts).map(([status, count], index) => {
                    const percentage = total > 0 ? (count / total) * 100 : 0;
                    return (
                      <div key={status} className="flex items-center justify-between text-sm">
                        <div className="flex items-center">
                          <div 
                            className="w-3 h-3 rounded-full mr-2"
                            style={{ backgroundColor: colors[index] }}
                          ></div>
                          <span className="text-medical-700">{labels[index]}</span>
                        </div>
                        <span className="font-medium text-medical-900">
                          {count} ({percentage.toFixed(1)}%)
                        </span>
                      </div>
                    );
                  });
                })()}
              </div>
            </div>

            {/* Confidence Score Distribution Pie Chart */}
            <div className="bg-white rounded-xl shadow-sm border border-medical-200 p-6">
              <h2 className="text-lg font-semibold text-medical-900 mb-6 text-center">
                Confidence Score Distribution
              </h2>
              <div className="flex justify-center">
                {(() => {
                  // Group confidence scores into buckets
                  const buckets = [
                    { label: '90-100%', color: '#10B981', count: 0 },
                    { label: '80-89%', color: '#3B82F6', count: 0 },
                    { label: '70-79%', color: '#F59E0B', count: 0 },
                    { label: 'Below 70%', color: '#EF4444', count: 0 },
                  ];
                  reports.forEach(r => {
                    if (r.confidence_score >= 0.9) buckets[0].count++;
                    else if (r.confidence_score >= 0.8) buckets[1].count++;
                    else if (r.confidence_score >= 0.7) buckets[2].count++;
                    else buckets[3].count++;
                  });
                  const total = reports.length;
                  let currentAngle = 0;
                  const segments = buckets.map((bucket, i) => {
                    const percentage = total > 0 ? (bucket.count / total) * 100 : 0;
                    const angle = (percentage / 100) * 360;
                    const startAngle = currentAngle;
                    currentAngle += angle;
                    return { ...bucket, percentage, startAngle, angle };
                  }).filter(s => s.count > 0);
                  return (
                    <svg className="w-48 h-48 transform -rotate-90" viewBox="0 0 100 100">
                      {segments.map((segment, i) => {
                        const radius = 40;
                        const circumference = 2 * Math.PI * radius;
                        const strokeDasharray = (segment.angle / 360) * circumference;
                        const strokeDashoffset = 0;
                        const x1 = 50 + radius * Math.cos((segment.startAngle * Math.PI) / 180);
                        const y1 = 50 + radius * Math.sin((segment.startAngle * Math.PI) / 180);
                        const x2 = 50 + radius * Math.cos(((segment.startAngle + segment.angle) * Math.PI) / 180);
                        const y2 = 50 + radius * Math.sin(((segment.startAngle + segment.angle) * Math.PI) / 180);
                        const largeArcFlag = segment.angle > 180 ? 1 : 0;
                        const pathData = `M50,50 L${x1},${y1} A${radius},${radius} 0 ${largeArcFlag} 1 ${x2},${y2} Z`;
                        return (
                          <path key={i} d={pathData} fill={segment.color} />
                        );
                      })}
                    </svg>
                  );
                })()}
              </div>
              <div className="flex justify-center mt-4 space-x-4">
                <div className="flex items-center space-x-2"><span className="w-3 h-3 rounded-full inline-block" style={{background:'#10B981'}}></span><span className="text-xs">90-100%</span></div>
                <div className="flex items-center space-x-2"><span className="w-3 h-3 rounded-full inline-block" style={{background:'#3B82F6'}}></span><span className="text-xs">80-89%</span></div>
                <div className="flex items-center space-x-2"><span className="w-3 h-3 rounded-full inline-block" style={{background:'#F59E0B'}}></span><span className="text-xs">70-79%</span></div>
                <div className="flex items-center space-x-2"><span className="w-3 h-3 rounded-full inline-block" style={{background:'#EF4444'}}></span><span className="text-xs">Below 70%</span></div>
              </div>
            </div>
          </div>
        )}

        {/* Reports List with Results */}
        <div className="bg-white rounded-xl shadow-sm border border-medical-200">
          <div className="px-6 py-4 border-b border-medical-200">
            <h2 className="text-lg font-semibold text-medical-900">Your Reports & Analysis Results</h2>
          </div>
          <div className="divide-y divide-medical-200">
            {reports.length === 0 ? (
              <div className="px-6 py-12 text-center">
                <DocumentTextIcon className="w-12 h-12 text-medical-400 mx-auto mb-4" />
                <h3 className="text-lg font-medium text-medical-900 mb-2">No reports yet</h3>
                <p className="text-medical-600 mb-4">
                  Upload your first blood test report to get started
                </p>
                <Link
                  to="/upload"
                  className="inline-flex items-center px-4 py-2 border border-transparent shadow-sm text-sm font-medium rounded-lg text-white bg-primary-600 hover:bg-primary-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500 transition-colors"
                >
                  <PlusIcon className="w-5 h-5 mr-2" />
                  Upload Report
                </Link>
              </div>
            ) : (
              reports.map((report) => (
                <div key={report.id} className="p-6 hover:bg-medical-50 transition-colors">
                  <div className="flex items-start justify-between mb-4">
                    <div className="flex items-center space-x-4">
                      {getStatusIcon(report.processing_status)}
                      <div>
                        <h3 className="text-lg font-medium text-medical-900">
                          {report.filename}
                        </h3>
                        <p className="text-sm text-medical-600">
                          Uploaded {new Date(report.upload_date).toLocaleDateString()}
                        </p>
                      </div>
                    </div>
                    <div className="flex items-center space-x-3">
                      <span className={`inline-flex items-center px-2.5 py-0.5 rounded-full text-xs font-medium ${getStatusColor(report.processing_status)}`}>
                        {report.processing_status}
                      </span>
                      <Link
                        to={`/report/${report.id}`}
                        className="inline-flex items-center px-3 py-1.5 border border-medical-300 shadow-sm text-xs font-medium rounded-md text-medical-700 bg-white hover:bg-medical-50 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-primary-500 transition-colors"
                      >
                        <EyeIcon className="w-4 h-4 mr-1" />
                        View Details
                      </Link>
                    </div>
                  </div>

                  {/* Analysis Result Preview */}
                  {report.processing_status === 'completed' && report.analysis_result && (
                    <div className="bg-medical-50 border border-medical-200 rounded-lg p-4">
                      <h4 className="text-sm font-medium text-medical-900 mb-2">Analysis Result:</h4>
                      <div className="text-sm text-medical-700 line-clamp-3">
                        {report.analysis_result.length > 200 
                          ? `${report.analysis_result.substring(0, 200)}...` 
                          : report.analysis_result
                        }
                      </div>
                      <Link
                        to={`/report/${report.id}`}
                        className="inline-flex items-center text-xs text-primary-600 hover:text-primary-700 mt-2"
                      >
                        Read full analysis →
                      </Link>
                    </div>
                  )}

                  {report.processing_status === 'processing' && (
                    <div className="bg-yellow-50 border border-yellow-200 rounded-lg p-4">
                      <div className="flex items-center">
                        <ClockIcon className="w-4 h-4 text-yellow-600 mr-2" />
                        <span className="text-sm text-yellow-800">Analysis in progress...</span>
                      </div>
                    </div>
                  )}

                  {report.processing_status === 'failed' && (
                    <div className="bg-red-50 border border-red-200 rounded-lg p-4">
                      <div className="flex items-center">
                        <ExclamationTriangleIcon className="w-4 h-4 text-red-600 mr-2" />
                        <span className="text-sm text-red-800">Analysis failed. Please try again.</span>
                      </div>
                    </div>
                  )}
                </div>
              ))
            )}
          </div>
        </div>

        {/* Previous Results Table */}
        <div className="bg-white rounded-xl shadow-sm border border-medical-200 p-6 mt-8">
          <h2 className="text-lg font-semibold text-medical-900 mb-4">Previous Results</h2>
          {reports.length === 0 ? (
            <div className="text-medical-600 text-center py-8">No reports found.</div>
          ) : (
            <div className="overflow-x-auto">
              <table className="min-w-full divide-y divide-medical-200">
                <thead className="bg-medical-50">
                  <tr>
                    <th className="px-4 py-2 text-left text-xs font-medium text-medical-500 uppercase tracking-wider">File Name</th>
                    <th className="px-4 py-2 text-left text-xs font-medium text-medical-500 uppercase tracking-wider">Upload Date</th>
                    <th className="px-4 py-2 text-left text-xs font-medium text-medical-500 uppercase tracking-wider">Status</th>
                    <th className="px-4 py-2 text-left text-xs font-medium text-medical-500 uppercase tracking-wider">Confidence</th>
                    <th className="px-4 py-2 text-left text-xs font-medium text-medical-500 uppercase tracking-wider">View</th>
                  </tr>
                </thead>
                <tbody className="bg-white divide-y divide-medical-200">
                  {reports.map((report) => (
                    <tr key={report.id} className="hover:bg-medical-50 transition-colors">
                      <td className="px-4 py-2 text-medical-900 font-medium">{report.filename}</td>
                      <td className="px-4 py-2 text-medical-700">{new Date(report.upload_date).toLocaleString()}</td>
                      <td className="px-4 py-2">
                        <span className={`inline-flex items-center px-2 py-1 rounded-full text-xs font-semibold ${getStatusColor(report.processing_status)}`}>
                          {getStatusIcon(report.processing_status)}
                          <span className="ml-1">{report.processing_status.charAt(0).toUpperCase() + report.processing_status.slice(1)}</span>
                        </span>
                      </td>
                      <td className="px-4 py-2 text-medical-700">{report.confidence_score ? `${(report.confidence_score*100).toFixed(1)}%` : '-'}</td>
                      <td className="px-4 py-2">
                        <Link to={`/report/${report.id}`} className="inline-flex items-center text-primary-600 hover:text-primary-800 font-medium">
                          <EyeIcon className="w-5 h-5 mr-1" /> View
                        </Link>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
